import { NavLink } from "react-router-dom";

const Navbar = () => {
  return <div>
    <nav>
      <div></div>
      <div>
        <NavLink to="/">Home</NavLink>
        <NavLink to="/cart"><img src='../../public/android-chrome-192x192.png' alt="Cart" width={120} height={120}/></NavLink>
      </div>
    </nav>
  </div>;
};

export default Navbar;
